import React from "react";

function Home() {
  return (
    <div id="home">
      <div className="titleContainer">
        <div className="title">HI</div>
        <div className="subtitle">I'm benjamin .</div>
      </div>

      <img src="layered-waves-haikei.svg" alt="" />
    </div>
  );
}

export default Home;
